La « petite circulation » ou circulation pulmonaire part du {{c1::ventricule droit}} et se termine dans {{c1::l’atrium
gauche}} et la « grande circulation » ou circulation générale part du {{c1::ventricule gauche}} et se termine
dans {{c1::l’atrium droit.}}

Le coeur présente un grand axe presque horizontal dirigé {{c1::en avant, à gauche et un peu en bas}}. Son axe peut
varier avec la morphologie du thorax : il se verticalise lorsque le thorax est {{c1::étroit}} ou au contraire
s’horizontalise lorsque le thorax est {{c1::large}}

Les troncs
principaux des artères coronaires et de leurs principales collatérales cheminent dans {{c1::les sillons du coeur}}. C’est
à ce niveau qu’elles sont abordées lors de {{c1::la réalisation des pontages coronaires}}

La face inférieure est diaphragmatique car elle repose sur le muscle diaphragme où elle décrit la
dépression du lit du cœur entre les deux coupoles diaphragmatiques. Elle est surtout occupée par le
ventricule {{c1::gauche}}, séparé à ce niveau du ventricule {{c1::droit}} par {{c1::le sillon interventriculaire postérieur}} où chemine {{c1::l’artère interventriculaire postérieure.}}

La paroi antérieure de l'atrium droit contient {{c1::l’ostium atrio-ventriculaire droit}} pratiquement vertical et occupé
par {{c1::la valve atrio-ventriculaire droite}} formée de trois {{c1::cuspides}} : répondant aux parois du ventricule droit ({{c1::septale}}, {{c1::antérieure}} et {{c1::postérieure ou inférieure}}) et recevant des cordages
issus des piliers implantés sur les parois du ventricule. <br>On décrit trois ordres de cordages
suivant leur implantation sur la cuspide : de premier ordre s’insérant sur {{c1::sa base d’insertion}} ;
de deuxième ordre, sur {{c1::sa face pariétale}} et de troisième ordre, sur {{c1::son bord libre.}}

Au-dessus de l'extrémité gauche de l’atrium gauche est appendu un {{c1::diverticule}}, {{c2::l’auricule gauche}}. Le
septum interatrial est marqué dans sa partie {{c1::antérieure et supérieure}} par {{c2::le repli semi-lunaire}}, vestige
gauche de {{c2::la fosse ovale}}

L’ostium aortique est constitué de {{c1::trois valvules
semi-lunaires}} ({{c1::deux antérieures ou coronaires}} et {{c1::une postérieure}}) avec aussi {{c1::un nodule (d’Arantius)}}
à la partie moyenne de leur bord libre.

L’ostium aortique est juste en arrière de l’orifice pulmonaire, son diamètre est de {{c1::20}} à {{c1::25 mm}}. Il se
compose de {{c1::deux valvules antérieures ou coronaires, une gauche et une droite}}, et {{c1::d’une valvule
postérieure}}

On
distingue pour chaque valve, {{c1::un appareil valvulaire}} ({{c2::anneau}} et {{c2::feuillets}}) et un {{c1::appareil sous valvulaire}}
({{c2::piliers musculaires}} et {{c2::cordages tendineux}}).

La valve mitrale, située à la base du ventricule gauche, elle mesure {{c1::30}} à {{c1::35 mm}} de diamètre.<br>Il comporte deux cuspides
: une {{c1::grande valve mitrale}} ou {{c1::cuspide septale}} insérée sur {{c1::le septum en avant}} et une {{c1::petite valve
mitrale}} ou {{c1::cuspide postérieure}}

Le cœur possède, au milieu des fibres myocardiques
différenciées, des cellules musculaires spécifiques qui produisent de façon rythmique des excitations:
c’est le système de {{c1::conduction de l’excitation}}, ou {{c1::tissu cardio-necteur.}}

L'aorte est un vaisseau d'une section de&nbsp;{{c1::2}} à {{c1::3}}cm2<br>Au niveau des capillaires, la surface d’échange est {{c1::1000}} fois plus importante qu’au début du
circuit ({{c1::2500}} cm2
)

Le volume télédiastolique (en fin de diastole)
est maximal après la contraction {{c1::auriculaire}} (elle finalise le remplissage ventriculaire pour ses {{c1::5}} à {{c1::10}}
derniers pourcents)

Loi du cœur de {{c1::Frank
- Starling}}<br>{{c2::La tension développée lors de la contraction myocardique
croît avec l’étirement jusqu’à une valeur optimale Lo}}

